public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }

  DiskBalancerVolume that = (DiskBalancerVolume) o;
  return uuid.equals(that.uuid);
}
